import "./styles.css";
import React, { useEffect, useState, useNavigate } from "react";
import MyComponent from "./component";
import GetPersonUserData from "./getperson";
import PostTimein from "./posttime";
import axios from 'axios';



export default function App() {

  const host = '192.168.1.224'
  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
      axios.get('http://192.168.1.224:5000/personuppgifter/personnummer')
          .then((response) => {
              setData(response.data);
          })
          .catch((error) => {
              setError(error.message);
              console.error('There was an error!', error);
          });
  }, []);
  

  const [result, setResult] = useState(1);
  const [count, setCount] = useState("0");

  let buttonList = [];
  for (let i = 1; i < 10; i++) {
    buttonList.push(
      <button key={i} value={i} onClick={(e) => add(e)}>
        {i}
      </button>
    );
  }

  function reset() {
    setResult(1);
    setCount("0");
  }

  function add(e) {
    if (count === "0") {
      setCount(e.target.value);
    } else {
      setCount((curr) => curr + e.target.value);
    }
  }

  //STÄMPLA IN 
  function CheckUserData() {
    const list = [];
  
    for (let i = 0; i < data.length; i++) {
      const allpnummer = Object.values(data[i]);
      let onepnummer;
      //console.log(allpnummer)
      try {
        onepnummer = JSON.parse(allpnummer);
      } catch (e) {
        console.error('Error parsing JSON:', e);
        continue;
      }
      list.push(onepnummer);
    }
  
    for (let item in list) {
      if (list[item] == count) {
        const persondata = {
          value1: count,
          value2: count,
          value3: count,
        };
        console.log("CORRECT");
  
        // GET request to /personuppgifter/login with query parameters
        axios.get('http://192.168.1.224:5000/personuppgifter/login', { params: persondata })
          .then((response) => {
            //console.log(response.data);
            const responseData = response.data;
            if (Array.isArray(responseData)) {
              const firstNames = responseData.map((item) => item.fornamn);
              const lastNames = responseData.map((item) => item.efternamn);
  
              const postData = {
                value1: count,
                value2: firstNames,
                value3: lastNames,
                value4: Today,
                value5: Today,
                value6: Today,
                value7: '',
              };
  
              // POST request to /
              axios.post('http://192.168.1.224:5000/', postData)
                .then((response) => {
                  //console.log(response.data);
                })
                .catch((error) => {
                  console.error('There was an error with the POST request!', error);
                });
            } else {
              console.error('Response data is not an array:', responseData);
            }
          })
          .catch((error) => {
            console.error('There was an error with the GET request!', error);
          });
  
        break; // Exit the loop after a match is found
      } else {
        console.log("SORRY");
      }
    }
    setCount("0");
  }



//STÄMPLA UT
function CheckUserDataOut() {
  const list = [];

  for (let i = 0; i < data.length; i++) {
    const allpnummer = Object.values(data[i]);
    let onepnummer;
    //console.log(allpnummer)
    try {
      onepnummer = JSON.parse(allpnummer);
    } catch (e) {
      console.error('Error parsing JSON:', e);
      continue;
    }
    list.push(onepnummer);
  }

  for (let item in list) {
    if (list[item] == count) {
      const persondata = {
        value1: count,
        value2: count,
        value3: count,
      };
      console.log("CORRECT");

      // GET request to /personuppgifter/login with query parameters
      axios.get('http://192.168.1.224:5000/personuppgifter/login', { params: persondata })
        .then((response) => {
          //console.log(response.data);
          const responseData = response.data;
          if (Array.isArray(responseData)) {
            const firstNames = responseData.map((item) => item.fornamn);
            const lastNames = responseData.map((item) => item.efternamn);

            const postData = {
              value1: count,
              value2: Today,
              value3: Today,
            };

            // POST request to /
            axios.put('http://192.168.1.224:5000/timein', postData)
              .then((response) => {
                //console.log(response.data);
              })
              .catch((error) => {
                console.error('There was an error with the POST request!', error);
              });
          } else {
            console.error('Response data is not an array:', responseData);
          }
        })
        .catch((error) => {
          console.error('There was an error with the GET request!', error);
        });

      break; // Exit the loop after a match is found
    } else {
      console.log("SORRY");
    }
  }
  setCount("0");
}

var d = new Date();
var datestring = d.getFullYear() + "-" + (d.getMonth()+1)  + "-" + d.getDate()
var Today = new Date().toLocaleString()
let date = new Date();
let formattedDate = new Intl.DateTimeFormat('sv-SV').format(date);

  return (
    

    <div className="App">
        <div className="boxContainer">
        <h1 className="title">Lummelunda Grill</h1>
    <div className="Calculator">
    
      <div className="flex">
        <div className="counter">
          <h1>{count === "1" ? result : count}</h1>
        </div>
      </div>

      <div className="flex">
        <div className="buttons btn-style">
          {buttonList}
          <button id="reset" onClick={reset}>X</button>
          <button value={0} onClick={(e) => add(e)}>
            0
          </button>
          <button id="hidden">X</button>
          <button id="in" onClick={CheckUserData}>IN</button>
          <button id="ut" onClick={CheckUserDataOut}>UT</button>
        </div>
        
      </div>
    
      
    </div>


    <div className="datablock">

<section>
  <h2>Personalliggare</h2>
  <h2>{formattedDate}</h2>
  <MyComponent />
</section>
        </div>
        
        </div>
        
        <footer>
        <p>
            Lummelunda Grill
        </p>
        <p>
            Orgnr
        </p>
      </footer>
    </div>
  );
}
